sys_variable_value.value:
(function execute(inputs, outputs) {

var payloadData = JSON.parse(inputs.responsebody);

var statusCode = inputs.statuscode;

if(statusCode == '200' || statusCode == '201' || statusCode == '202'){
outputs.authtoken = payloadData.access_token;
}

})(inputs, outputs);

